  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0104264 includes physical
  and underway data collected aboard the HEALY during cruise HLY11TE in the Bering
  Sea, Gulf of Alaska and North Pacific Ocean from 2011-10-29 to 2011-11-01. These
  data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by United States Coast Guard as part of Transit. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program. The ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
